import React from 'react'
import { Route, Switch } from 'react-router-dom';
import AboutMeComponent from '../src/component/AboutMeComponent'
import AboutUnsplashComponent from '../src/component/AboutUnsplashComponent'
import ContactComponent from '../src/component/ContactComponent'
import NotFound from './component/NotFound';


function App() {
  return (
    <div >
      <Switch> {/** switch will visit each path and find right route*/}

      <Route exact path="/" component={ContactComponent}/>
      <Route exact path="/AboutMeComponent" component={AboutMeComponent}/>
      <Route component={NotFound}> </Route>

      </Switch>


     <AboutUnsplashComponent/>
     <ContactComponent/>
    </div>
  );
}

export default App;
